import { Component, Renderer2 } from '@angular/core';
import { ApiService } from '../../service/api.service';
import { Partido } from '../../modelo/partidos';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrl: './home.component.css'
})
export class HomeComponent {

  constructor(private apiService: ApiService, private renderer: Renderer2) {
    this.renderer.setStyle(document.body, 'background', 'url("../../../assets/imgs/pista-baloncesto.png")');
    this.renderer.setStyle(document.body, 'background-size', 'cover');
    this.renderer.setStyle(document.body, 'background-repeat', 'no-repeat');
    this.renderer.setStyle(document.body, 'background-attachment', 'fixed');
  }

  partidos = [{ id: 1, nombre: "Granada - Madrid", fecha: "11-01-24", tengoEntrada: false }, { id: 2, nombre: "Granada - Málaga", fecha: "21-03-24", tengoEntrada: false },
  { id: 3, nombre: "Granada - Mallorca", fecha: "24-01-24", tengoEntrada: false }, { id: 4, nombre: "Granada - Valencia", fecha: "24-01-24", tengoEntrada: false },
  { id: 5, nombre: "Granada - Barça", fecha: "24-01-24", tengoEntrada: false }];
  misPartidosIds = [1, 2]
  
  idUsuario:number
  ngOnInit() {
    this.idUsuario = 1; //TODO: coger id de variable global
    // let user = localStorage.getItem('user');
    // let idUsuario: number
    // if(user == null)
    //   idUsuario = -1
    // else
    //   idUsuario = parseInt(user)
    //this.apiService.getProximosPartidos().subscribe(response => {this.partidos = response});
    //this.apiService.getMisPartidosIds(this.idUsuario).subscribe(response => {this.misPartidosIds = response});
    this.partidos.forEach(partido => {
      if (this.misPartidosIds.includes(partido.id))
        partido.tengoEntrada = true;
      else
        partido.tengoEntrada = false;
    })
  }

  //TODO: recibir respuesta de servidor con ok o error para continuar con foreach
  apuntarse(idPartido: number) {
    this.apiService.asignarEntrada(this.idUsuario, idPartido);
    this.partidos.forEach(partido => {
      if (partido.id == idPartido)
        partido.tengoEntrada = true;
    });
  }

  desapuntarse(idPartido: number) {
    this.apiService.desasignarEntrada(this.idUsuario, idPartido);
    this.partidos.forEach(partido => {
      if (partido.id == idPartido)
        partido.tengoEntrada = false;
    });
  }

  base64PDF = ""
  descargar(idPartido: number) {
    // this.apiService.getEntradaBase64(idPartido, this.idUsuario).subscribe(data => {
    //   let blob = this.base64ToBlob(data, "application/pdf")
    //   this.saveBlobAsTextFile(blob, "entrada.pdf")
    // });
      let blob = this.base64ToBlob(this.base64PDF, "application/pdf")
      this.saveBlobAsTextFile(blob, "entrada.pdf")
  }

  base64ToBlob(base64String:string, contentType = ''): Blob {
    const byteCharacters = atob(base64String);
    const byteArrays = [];

    for (let i = 0; i < byteCharacters.length; i++) {
      byteArrays.push(byteCharacters.charCodeAt(i));
    }

    const byteArray = new Uint8Array(byteArrays);
    return new Blob([byteArray], { type: contentType });
  }

  saveBlobAsTextFile(blob: Blob, fileName: string): void {
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = fileName;
    link.click();
  }

}
